import React from 'react';
import './PortfolioPreview.css';

const PortfolioPreview = ({ theme }) => {
  const getPortfolioContent = () => {
    switch (theme) {
      case 'Mafia':
        return 'Check out our greatest hits and see how we can take care of your business.';
      case 'Drug Game':
        return 'Our product is top-notch. Here’s what we’ve been cooking up.';
      case 'Adult Entertainment':
        return 'Keep your audience entertained with our high-quality solutions.';
      case 'Monopoly':
        return 'Control the market with our powerful portfolio.';
      case 'Foodie Influencer':
        return 'Feast your eyes on our most delicious digital creations.';
      case 'Social Media Influencer':
        return 'See how we made other brands go viral with our portfolio.';
      default:
        return 'Explore our latest projects and case studies.';
    }
  };

  return (
    <section
      className={`portfolio-preview ${theme.toLowerCase()}`}
      data-aos="fade-up"
    >
      <h2>Our Portfolio</h2>
      <p>{getPortfolioContent()}</p>
    </section>
  );
};

export default PortfolioPreview;
